import React, { Component } from "react";
import styled from 'styled-components';

const Wrapper = styled.div`

    transition: 1s ease;
    min-height: 100vh;
    width: 100vw;
    position: fixed;
    z-index: 50;
    height: 55px;
    opacity:  ${props => (props.hide === true ? "0" : "1")}
    background-color: rgba(0,0,0,.5);
    display: ${props => (props.hide === true ? "none" : "flex")};

    .flex {
        max-width: 775px;
        display: flex;
        align-items: center;
        width: 100%;
        justify-content: space-between;
        margin: 0 auto;
    }

`

const Links = styled.div`

    position: fixed;
    right: 0;

`

const Divider = styled.div`

    width: 50px;
    height: 2px;
    background-color: white;

`

const MobileNavSlide = (props) => {
    return (
        <Wrapper hide={props.hidden}>
            <Links>
                <h1>Premium</h1>
                <h1>Download</h1>
                <Divider/>
                <h2>Sign Up</h2>
                <h2>Log In</h2>
            </Links>
        </Wrapper>
    );
}

export default MobileNavSlide;
